import React from "react";
import { Link, Outlet } from "react-router-dom";

const NavBar = () => {
    return (
        <>
            <ul className="nav">
                <li className="nav-item">
                    <Link to="/">Main</Link>
                </li>
                <li className="nav-item">
                    <a className="nav-link" href="#">
                        Link
                    </a>
                </li>
                <li className="nav-item">
                    <Link to="/login">Login</Link>
                </li>
                <li className="nav-item">
                    <Link to="/films">Users</Link>
                </li>
            </ul>

            <Outlet />

            <footer>2023</footer>
        </>
    );
};

export default NavBar;
